INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 2, 1, 0, 5118061, 2834, 0, 40, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", "青空の下で謁見", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 2, 1, 0, 5118062, 2835, 0, 40, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", "未来の騎空団\nマスコット？", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 2, 1, 0, 5118063, 2837, 0, 40, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", "お嬢さまからの\n緊急依頼", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 2, 1, 0, 5118064, 4108402, 0, 40, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", "黄金色の悩みごと", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 2, 1, 0, 5118065, 4107402, 0, 40, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", "白熱！　格闘大会！", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "オーエド町", 10118, 2, 1, 1, 5118066, 9000227, 0, 40, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", "祭り太鼓はオーエドの華", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 3, 1, 0, 5118067, 2101181, 0, 40, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", "人気者は遅れて\nやってくる", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 3, 1, 0, 5118068, 4109402, 0, 40, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", "巫女・ミーツ・魔法少女", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 3, 1, 0, 5118069, 4305402, 0, 40, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", "ネズ耳は二度なくなる", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 3, 1, 0, 5118070, 4101402, 0, 40, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", "この出会いにカンパイ！", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "ランドソル市街地", 10118, 3, 1, 0, 5118071, 4106402, 0, 40, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", "陰陽アンサンブル", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (91002, "フリーマーケット会場", 10118, 3, 1, 1, 5118072, 2836, 0, 40, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", "運試し十番勝負！", 8);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (0, 0, 10118, 1, 0, 0, 5118600, 0, 10145115, 0, 0, 0, "オープニング", "彼女たちの新たな日常", 0);
